import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { artistAPI, getImageURL } from '../../services/api';
import './ArtistProfile.css';

function ArtistProfile() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [artist, setArtist] = useState(null);
  const [artworks, setArtworks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState('all');

  useEffect(() => {
    const fetchArtistProfile = async () => {
      try {
        setLoading(true);
        const response = await artistAPI.getArtistById(id);
        const data = response.data.data;
        
        setArtist({
          artist_id: data.artist_id,
          artist_name: data.artist_name,
          bio: data.bio,
          contact_email: data.contact_email,
          phone: data.phone
        });
        
        // ‚úÖ Filter out artwork_id 20 (Vertical Abstract)
        const filteredArtworks = (data.artworks || []).filter(art => art.artwork_id !== 20);
        setArtworks(filteredArtworks);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching artist profile:', error);
        setLoading(false);
      }
    };

    fetchArtistProfile();
  }, [id]);

  const getFilteredArtworks = () => {
    if (filter === 'all') return artworks;
    if (filter === 'bestsellers') return artworks.filter(art => art.is_bestseller);
    if (filter === 'price_low') return [...artworks].sort((a, b) => a.price - b.price);
    if (filter === 'price_high') return [...artworks].sort((a, b) => b.price - a.price);
    return artworks;
  };

  const getStats = () => {
    const totalArtworks = artworks.length;
    const bestsellers = artworks.filter(art => art.is_bestseller).length;
    const totalViews = artworks.reduce((sum, art) => sum + art.views, 0);
    const avgPrice = artworks.length > 0 
      ? Math.round(artworks.reduce((sum, art) => sum + art.price, 0) / artworks.length)
      : 0;

    return { totalArtworks, bestsellers, totalViews, avgPrice };
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Loading artist profile...</p>
      </div>
    );
  }

  if (!artist) {
    return (
      <div className="error-container">
        <h2>Artist not found</h2>
        <button onClick={() => navigate('/')}>Back to Home</button>
      </div>
    );
  }

  const stats = getStats();
  const filteredArtworks = getFilteredArtworks();

  return (
    <div className="artist-profile-container">
      <button className="back-btn" onClick={() => navigate(-1)}>
        ‚Üê Back
      </button>

      <div className="artist-header-section">
        <div className="artist-avatar">
          <div className="avatar-circle">
            {artist.artist_name.charAt(0)}
          </div>
        </div>
        
        <div className="artist-info-main">
          <h1>{artist.artist_name}</h1>
          <p className="artist-bio-large">{artist.bio}</p>
          
          <div className="contact-info">
            <div className="contact-detail">
              <span className="icon">üìß</span>
              <span>{artist.contact_email}</span>
            </div>
            <div className="contact-detail">
              <span className="icon">üì±</span>
              <span>{artist.phone}</span>
            </div>
          </div>
        </div>
      </div>

      <div className="stats-section">
        <div className="stat-card">
          <div className="stat-icon">üé®</div>
          <div className="stat-info">
            <h3>{stats.totalArtworks}</h3>
            <p>Total Artworks</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">‚≠ê</div>
          <div className="stat-info">
            <h3>{stats.bestsellers}</h3>
            <p>Best Sellers</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üëÅÔ∏è</div>
          <div className="stat-info">
            <h3>{stats.totalViews.toLocaleString()}</h3>
            <p>Total Views</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üí∞</div>
          <div className="stat-info">
            <h3>NPR {stats.avgPrice.toLocaleString()}</h3>
            <p>Avg. Price</p>
          </div>
        </div>
      </div>

      <div className="filter-section">
        <h2>Artworks Collection</h2>
        <div className="filter-buttons">
          <button 
            className={filter === 'all' ? 'active' : ''}
            onClick={() => setFilter('all')}
          >
            All ({artworks.length})
          </button>
          <button 
            className={filter === 'bestsellers' ? 'active' : ''}
            onClick={() => setFilter('bestsellers')}
          >
            Best Sellers ({stats.bestsellers})
          </button>
          <button 
            className={filter === 'price_low' ? 'active' : ''}
            onClick={() => setFilter('price_low')}
          >
            Price: Low to High
          </button>
          <button 
            className={filter === 'price_high' ? 'active' : ''}
            onClick={() => setFilter('price_high')}
          >
            Price: High to Low
          </button>
        </div>
      </div>

      <div className="artworks-gallery">
        {filteredArtworks.length === 0 ? (
          <div className="no-artworks">
            <p>No artworks found</p>
          </div>
        ) : (
          filteredArtworks.map((artwork) => (
            <div 
              key={artwork.artwork_id}
              className="gallery-card"
              onClick={() => navigate(`/artwork/${artwork.artwork_id}`)}
            >
              <div className="gallery-image">
                <img 
                  src={getImageURL(artwork.image_url)} 
                  alt={artwork.title}
                  onError={(e) => {
                    e.target.src = 'https://via.placeholder.com/300x400?text=Image+Not+Found';
                  }}
                />
                {artwork.is_bestseller && (
                  <span className="bestseller-tag">‚≠ê Best Seller</span>
                )}
              </div>
              
              <div className="gallery-info">
                <h3>{artwork.title}</h3>
                <p className="category">{artwork.category}</p>
                <div className="artwork-meta">
                  <span className="size">{artwork.wall_size}</span>
                  <span className="views">üëÅÔ∏è {artwork.views}</span>
                </div>
                <p className="price">NPR {artwork.price.toLocaleString()}</p>
                <button className="view-btn">View Details ‚Üí</button>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
